ession in the cluster of interest. The p-value is a measure of the statistical significance of the expression difference and is based on a negative binomial test. The p-value reported here has been adjusted for multiple testing via the Benjamini-Hochberg procedure. In this table you can click on a column to sort by that value. Also, in this table features were filtered by (Mean UMI counts > 1.0) and the top N features by L2FC for each cluster were retained. Features with L2FC < 0 or adjusted p-value >= 0.10 were grayed out. The number of top features shown per cluster, N, is set to limit the number of table entries shown to 10,000; N=10,000/K^2 where K is the number of clusters. N can range from 1 to 50. For the full table, please refer to the 'differential_expression.csv' files produced by the pipeline.", "title": "Top Features by Cluster (Log2 fold-change, p-value)"}}}, "alarms": {"alarms": []}, "diagnostics": {"tso_frac": 0.18739010523335747, "sample_index_bases_with_q30_frac": 0.9571349295984568}, "summary_tab": {"filtered_bcs_transcriptome_union": {"threshold": "pass", "metric": "3,074", "name": "Estimated Number of Cells"}, "multi_transcriptome_total_raw_reads_per_filtered_bc": {"threshold": "pass", "metric": "79,925", "name": "Mean Reads per Cell"}, "pipeline_info_table": {"header": ["Sample"], "rows": [["Sample ID", "N1KO10_CKDL200167810-1a-SI_GA_A8_HNNKFDSXY"], ["Sample Description", ""], ["Chemistry", "Single Cell 3' v3"], ["Reference Path", "/fs/project/PAS1475/tools/refdata-gex-GRCh38-2020-A"], ["Transcriptome", "GRCh38-2020-A"], ["Pipeline Version", "cellranger-4.0.0"]]}, "sequencing": {"table": {"rows": [["Number of Reads", "245,690,726"], ["Valid Barcodes", "97.6%"], ["Valid UMIs", "99.8%"], ["Sequencing Saturation", "54.6%"], ["Q30 Bases in Barcode", "97.2%"], ["Q30 Bases in RNA Read", "93.4%"], ["Q30 Bases in UMI", "97.0%"]]}, "help": {"data": [["Number of Reads", ["Total number of read pairs that were assigned to this library in demultiplexing."]],
